import Background from '../../../public/img/pfoto.jpg';

const Home = ()=>{

    var sectionStyle = {
        width: "100%",
        height: "400px",
        backgroundImage: "url(" + { Background } + ")"
      };

    return(
        <div style={{ 
            backgroundImage: `url(${process.env.PUBLIC_URL + '/img/pfoto.jpg'})` 
          }}>
            Hello World
          </div>
    )
}

export default Home
